INSERT INTO `adm_produtos` (`id`, `nome`, `descricao`, `valor_max`, `perc_comissao`, `peso`, `largura`, `comprimento`, `altura`, `status_id`, `fl_oculta_qtde`, `txt_oculta_qtde`, `fl_ajuda_qtde`, `txt_ajuda`, `created_at`, `updated_at`, `fl_desconto`, `valor_min`) VALUES
(7, 'Impressão Preto e Branco A4', '<div>\r\n	<p>\r\n		<strong>Impress&atilde;o <u>de texto</u> com qualidade</strong>&nbsp;apenas na&nbsp;<strong>cor&nbsp;preta</strong>, no&nbsp;<strong>formato A4</strong>&nbsp;(dimens&atilde;o: 21,0 cm x 29,7 cm), em impressoras de porte gr&aacute;fico.</p>\r\n	<p>\r\n		Para grandes quantidades, voc&ecirc; pode solicitar uma an&aacute;lise de desconto, no momento da compra,&nbsp;<strong style="color: rgb(255, 0, 0); ">assinalando a op&ccedil;&atilde;o &quot;Quero solicitar a an&aacute;lise de desconto&quot;</strong>.</p>\r\n	<p>\r\n		Os arquivos aceitos s&atilde;o: Adobe Reader (PDF), Imagens em Geral (JPG, TIFF e outros), Corel Draw (CDR) e arquivos compactados (ZIP e RAP) desde que contenham os arquivos citados anteriormente.</p>\r\n	<p>\r\n		N&atilde;o ser&atilde;o aceitos arquivos do pacote Microsoft Office por problemas de formata&ccedil;&atilde;o e fonte. Contudo voc&ecirc; pode nos enviar esses documentos no formato PDF salvando-os como PDF (na vers&atilde;o Office 2010) ou imprimindo-os em uma impressora virtual que converte qualquer documento em PDF (<a href="http://www.superdownloads.com.br/download/24/dopdf/">clique aqui e baixe o aplicativo doPDF</a>).</p>\r\n	<p>\r\n		Tamb&eacute;m &eacute; importante ressaltar que a qualidade da impress&atilde;o de imagens, em separado ou dentro dos documentos a serem impressos, dependem exclusivamente da qualidade da pr&oacute;pria imagem (resolu&ccedil;&atilde;o, dpi e afins).</p>\r\n	<p>\r\n		Caso haja a necessidade de impress&otilde;es em &quot;preto e branco&quot; e &quot;coloridas&quot; em um mesmo arquivo, &eacute; necess&aacute;rio que sejam adquiridos produtos diferentes. Nesses casos, deve-se adquirir o produto &quot;Impress&atilde;o A4 Preto e Branco&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Preto e Branco&quot; para as impress&otilde;es &quot;preto e branco&quot; e&nbsp;o produto &quot;Impress&atilde;o A4 Colorida&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Colorida&quot; para as impress&otilde;es &quot;coloridas&quot;. Caso haja tamb&eacute;m a necessidade de encaderna&ccedil;&atilde;o juntamente com essa divis&atilde;o, detalhe melhor essas informa&ccedil;&otilde;es no campo &quot;observa&ccedil;&atilde;o&quot; no momento da compra e/ou entre em contato conosco para acerto de detalhes.</p>\r\n	<p>\r\n		Na encaderna&ccedil;&atilde;o em &quot;Espiral&quot; ou em &quot;Wire-o&quot; ser&aacute; utilizada capa transparente transl&uacute;cido, capa de fundo preto fosco em PP e&nbsp;o&nbsp;espiral ou arame utilizados tamb&eacute;m ser&aacute; na cor preta. A encaderna&ccedil;&atilde;o do tipo &quot;Wire-o&quot;&nbsp;aceita 110 folhas no m&aacute;ximo.</p>\r\n	<p>\r\n		Se voc&ecirc; ainda tem d&uacute;vidas, <a href="/contato">entre em contato conosco</a>.</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', 0.200, 0.100, 2.000, 23.000, 31.000, 0.010, 9, 0, '', 1, 'Quantidade de folhas a serem impressas', '2011-09-11 00:08:29', '2011-11-22 11:57:53', 1, 0.200),
(8, 'Impressão Preto e Branco A3', '<p>\r\n	<strong>Impress&atilde;o&nbsp;<u>de texto</u>&nbsp;com qualidade</strong>&nbsp;apenas na&nbsp;<strong>cor&nbsp;preta</strong>&nbsp;no&nbsp;<strong>formato A3</strong>&nbsp;(dimens&atilde;o: &nbsp;29,7cm x 42,0 cm), em impressoras de porte gr&aacute;fico.</p>\r\n<div>\r\n	<div>\r\n		<p>\r\n			Para grandes quantidades, voc&ecirc; pode solicitar uma an&aacute;lise de desconto, no momento da compra,&nbsp;<strong style="color: rgb(255, 0, 0); ">assinalando a op&ccedil;&atilde;o &quot;Quero solicitar a an&aacute;lise de desconto&quot;</strong>.</p>\r\n		<p>\r\n			Os arquivos aceitos s&atilde;o: Adobe Reader (PDF), Imagens em Geral (JPG, TIFF e outros), Corel Draw (CDR) e arquivos compactados (ZIP e RAP) desde que contenham os arquivos citados anteriormente.</p>\r\n		<p>\r\n			N&atilde;o ser&atilde;o aceitos arquivos do pacote Microsoft Office por problemas de formata&ccedil;&atilde;o e fonte. Contudo voc&ecirc; pode nos enviar esses documentos no formato PDF salvando-os como PDF (na vers&atilde;o Office 2010) ou imprimindo-os em uma impressora virtual que converte qualquer documento em PDF (<a href="http://www.superdownloads.com.br/download/24/dopdf/">clique aqui e baixe o aplicativo doPDF</a>).</p>\r\n		<p>\r\n			Tamb&eacute;m &eacute; importante ressaltar que a qualidade da impress&atilde;o de imagens, em separado ou dentro dos documentos a serem impressos, dependem exclusivamente da qualidade da pr&oacute;pria imagem (resolu&ccedil;&atilde;o, dpi e afins).</p>\r\n		<p>\r\n			Caso haja a necessidade de impress&otilde;es em &quot;preto e branco&quot; e &quot;coloridas&quot; em um mesmo arquivo, &eacute; necess&aacute;rio que sejam adquiridos produtos diferentes. Nesses casos, deve-se adquirir o produto &quot;Impress&atilde;o A4 Preto e Branco&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Preto e Branco&quot; para as impress&otilde;es &quot;preto e branco&quot; e&nbsp;o produto &quot;Impress&atilde;o A4 Colorida&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Colorida&quot; para as impress&otilde;es &quot;coloridas&quot;. Caso haja tamb&eacute;m a necessidade de encaderna&ccedil;&atilde;o juntamente com essa divis&atilde;o, detalhe melhor essas informa&ccedil;&otilde;es no campo &quot;observa&ccedil;&atilde;o&quot; no momento da compra e/ou entre em contato conosco para acerto de detalhes.</p>\r\n		<p>\r\n			Na encaderna&ccedil;&atilde;o ser&aacute; utilizada capa transparente transl&uacute;cido, capa de fundo preto fosco em PP e&nbsp;o&nbsp;espiral utilizado tamb&eacute;m ser&aacute; na cor preta.&nbsp;</p>\r\n		<p>\r\n			Se voc&ecirc; ainda tem d&uacute;vidas,&nbsp;<a href="/contato">entre em contato conosco</a>.</p>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', 0.400, 0.100, 2.000, 44.000, 32.000, 0.010, 9, 0, '', 1, 'Quantidades de folhas a serem impressas', '2011-09-11 00:19:32', '2011-11-22 11:58:08', 1, 0.400),
(9, 'Impressão Colorida A4', '<p>\r\n	<strong>Impress&atilde;o a laser colorida</strong> no <strong>formato A4</strong>&nbsp;(dimens&atilde;o: 21,0 cm x 29,7 cm), em impressoras de porte gr&aacute;fico.</p>\r\n<div>\r\n	<div>\r\n		<p>\r\n			Para grandes quantidades, voc&ecirc; pode solicitar uma an&aacute;lise de desconto, no momento da compra,&nbsp;<strong style="color: rgb(255, 0, 0); ">assinalando a op&ccedil;&atilde;o &quot;Quero solicitar a an&aacute;lise de desconto&quot;</strong>.</p>\r\n	</div>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		Os arquivos aceitos s&atilde;o: Adobe Reader (PDF), Imagens em Geral (JPG, TIFF e outros), Corel Draw (CDR) e arquivos compactados (ZIP e RAP) desde que contenham os arquivos citados anteriormente.</p>\r\n	<p>\r\n		N&atilde;o ser&atilde;o aceitos arquivos do pacote Microsoft Office por problemas de formata&ccedil;&atilde;o e fonte. Contudo voc&ecirc; pode nos enviar esses documentos no formato PDF salvando-os como PDF (na vers&atilde;o Office 2010) ou imprimindo-os em uma impressora virtual que converte qualquer documento em PDF (<a href="http://www.superdownloads.com.br/download/24/dopdf/">clique aqui e baixe o aplicativo doPDF</a>).</p>\r\n	<p>\r\n		Tamb&eacute;m &eacute; importante ressaltar que a qualidade da impress&atilde;o de imagens, em separado ou dentro dos documentos a serem impressos, dependem exclusivamente da qualidade da pr&oacute;pria imagem (resolu&ccedil;&atilde;o, dpi e afins).</p>\r\n	<p>\r\n		Caso haja a necessidade de impress&otilde;es em &quot;preto e branco&quot; e &quot;coloridas&quot; em um mesmo arquivo, &eacute; necess&aacute;rio que sejam adquiridos produtos diferentes. Nesses casos, deve-se adquirir o produto &quot;Impress&atilde;o A4 Preto e Branco&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Preto e Branco&quot; para as impress&otilde;es &quot;preto e branco&quot; e&nbsp;o produto &quot;Impress&atilde;o A4 Colorida&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Colorida&quot; para as impress&otilde;es &quot;coloridas&quot;. Caso haja tamb&eacute;m a necessidade de encaderna&ccedil;&atilde;o juntamente com essa divis&atilde;o, detalhe melhor essas informa&ccedil;&otilde;es no campo &quot;observa&ccedil;&atilde;o&quot; no momento da compra e/ou entre em contato conosco para acerto de detalhes.</p>\r\n	<p>\r\n		Na encaderna&ccedil;&atilde;o em &quot;Espiral&quot; ou em &quot;Wire-o&quot; ser&aacute; utilizada capa transparente transl&uacute;cido, capa de fundo preto fosco em PP e&nbsp;o&nbsp;espiral ou arame utilizados tamb&eacute;m s&atilde;o da cor preta. A encaderna&ccedil;&atilde;o do tipo &quot;Wire-o&quot;&nbsp;aceita 110 folhas no m&aacute;ximo.</p>\r\n	<p>\r\n		Se voc&ecirc; ainda tem d&uacute;vidas,&nbsp;<a href="/contato">entre em contato conosco</a>.</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', 1.500, 0.100, 2.000, 23.000, 31.000, 0.010, 9, 0, '', 1, 'Quantidade de folhas a serem impressas', '2011-09-11 00:50:03', '2011-11-22 11:58:18', 1, 1.500),
(15, 'Impressão Colorida A3', '<p>\r\n	<strong>Impress&atilde;o a laser colorida</strong> no <strong>formato A3</strong> (dimens&atilde;o: 29,7 cm x 42,0 cm), em impressoras de porte gr&aacute;fico.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Para grandes quantidades, voc&ecirc; pode solicitar uma an&aacute;lise de desconto, no momento da compra,&nbsp;<strong style="color: rgb(255, 0, 0); ">assinalando a op&ccedil;&atilde;o &quot;Quero solicitar a an&aacute;lise de desconto&quot;</strong>.</p>\r\n<p>\r\n	Os arquivos aceitos s&atilde;o: Adobe Reader (PDF), Imagens em Geral (JPG, TIFF e outros), Corel Draw (CDR) e arquivos compactados (ZIP e RAP) desde que contenham os arquivos citados anteriormente.</p>\r\n<p>\r\n	N&atilde;o ser&atilde;o aceitos arquivos do pacote Microsoft Office por problemas de formata&ccedil;&atilde;o e fonte. Contudo voc&ecirc; pode nos enviar esses documentos no formato PDF salvando-os como PDF (na vers&atilde;o Office 2010) ou imprimindo-os em uma impressora virtual que converte qualquer documento em PDF (<a href="http://www.superdownloads.com.br/download/24/dopdf/">clique aqui e baixe o aplicativo doPDF</a>).</p>\r\n<p>\r\n	Tamb&eacute;m &eacute; importante ressaltar que a qualidade da impress&atilde;o de imagens, em separado ou dentro dos documentos a serem impressos, dependem exclusivamente da qualidade da pr&oacute;pria imagem (resolu&ccedil;&atilde;o, dpi e afins).</p>\r\n<p>\r\n	Caso haja a necessidade de impress&otilde;es em &quot;preto e branco&quot; e &quot;coloridas&quot; em um mesmo arquivo, &eacute; necess&aacute;rio que sejam adquiridos produtos diferentes. Nesses casos, deve-se adquirir o produto &quot;Impress&atilde;o A4 Preto e Branco&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Preto e Branco&quot; para as impress&otilde;es &quot;preto e branco&quot; e&nbsp;o produto &quot;Impress&atilde;o A4 Colorida&quot; ou&nbsp;&quot;Impress&atilde;o A3&nbsp;Colorida&quot; para as impress&otilde;es &quot;coloridas&quot;. Caso haja tamb&eacute;m a necessidade de encaderna&ccedil;&atilde;o juntamente com essa divis&atilde;o, detalhe melhor essas informa&ccedil;&otilde;es no campo &quot;observa&ccedil;&atilde;o&quot; no momento da compra e/ou entre em contato conosco para acerto de detalhes.</p>\r\n<p>\r\n	Na encaderna&ccedil;&atilde;o ser&aacute; utilizada capa transparente transl&uacute;cido, capa de fundo preto fosco em PP e&nbsp;o&nbsp;espiral utilizado tamb&eacute;m ser&aacute; na cor preta.&nbsp;</p>\r\n<p>\r\n	Se voc&ecirc; ainda tem d&uacute;vidas,&nbsp;<a href="/contato">entre em contato conosco</a>.</p>\r\n<p>\r\n	&nbsp;</p>\r\n', 3.000, 0.100, 2.000, 44.000, 32.000, 0.010, 9, 0, '', 1, 'Quantidades de folhas a serem impressas', '2011-11-09 17:35:15', '2011-11-22 11:58:29', 1, 3.000),
(16, 'Panfletos P/B - formato 10,5 x 15,0 cm (1.000 unidades)', '<p>\r\n	<strong>Impress&atilde;o de qualidade,&nbsp;</strong>apenas na&nbsp;<strong>cor&nbsp;preta</strong>, no&nbsp;<strong>formato A6&nbsp;</strong>(dimens&atilde;o: 10,5 x 15,0 cm).</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Impress&atilde;o em papel sulfite branco,&nbsp;75g/m&sup2;.&nbsp; Se desejar alterar a cor do papel, verifique no momento da realiza&ccedil;&atilde;o do pedido, quais as cores dispon&iacute;veis.</p>\r\n<p>\r\n	A arte final do panfleto deve ser enviada com as seguintes extens&otilde;es de arquivos:&nbsp;Adobe Reader (PDF) e Corel Draw (CDR).</p>\r\n<p>\r\n	N&atilde;o ser&atilde;o aceitos arquivos do pacote Microsoft Office por problemas de formata&ccedil;&atilde;o e fonte. Contudo voc&ecirc; pode nos enviar esses documentos no formato PDF salvando-os como PDF (na vers&atilde;o Office 2010) ou imprimindo-os em uma impressora virtual que converte qualquer documento em PDF (<a href="http://www.superdownloads.com.br/download/24/dopdf/">clique aqui e baixe o aplicativo doPDF</a>).</p>\r\n<p>\r\n	Se voc&ecirc; ainda tem d&uacute;vidas,&nbsp;<a href="/contato">entre em contato conosco</a>.</p>\r\n', 37.500, 0.100, 1200.000, 12.000, 16.000, 12.000, 9, 0, '', 1, 'Insira a quantidade de milheiros que deseja', '2011-11-20 18:21:42', '2011-11-22 11:57:09', 0, 37.500),
(17, 'Panfletos P/B - formato 15,0 x 21,0 cm (1.000 unidades)', '<p>\r\n	&nbsp;</p>\r\n<div>\r\n	<p>\r\n		<strong>Impress&atilde;o de qualidade,&nbsp;</strong>apenas na&nbsp;<strong>cor&nbsp;preta</strong>, no&nbsp;<strong>formato A5&nbsp;</strong>(dimens&atilde;o: 15,0 x 21,0 cm).</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		Impress&atilde;o em papel sulfite branco,&nbsp;75g/m&sup2;.&nbsp; Se desejar alterar a cor do papel, verifique no momento da realiza&ccedil;&atilde;o do pedido, quais as cores dispon&iacute;veis.</p>\r\n	<p>\r\n		A arte final do panfleto deve ser enviada com as seguintes extens&otilde;es de arquivos:&nbsp;Adobe Reader (PDF) e Corel Draw (CDR).</p>\r\n	<p>\r\n		N&atilde;o ser&atilde;o aceitos arquivos do pacote Microsoft Office por problemas de formata&ccedil;&atilde;o e fonte. Contudo voc&ecirc; pode nos enviar esses documentos no formato PDF salvando-os como PDF (na vers&atilde;o Office 2010) ou imprimindo-os em uma impressora virtual que converte qualquer documento em PDF (<a href="http://www.superdownloads.com.br/download/24/dopdf/">clique aqui e baixe o aplicativo doPDF</a>).</p>\r\n	<p>\r\n		Se voc&ecirc; ainda tem d&uacute;vidas,&nbsp;<a href="/contato">entre em contato conosco</a>.</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', 75.000, 0.100, 2350.000, 15.000, 21.000, 12.000, 9, 0, '', 1, 'Insira a quantidade de milheiros que deseja', '2011-11-20 18:25:48', '2011-11-21 17:08:43', 0, 75.000);
